function createShader(gl, type, source){
    const shader = gl.createShader(type)
    gl.shaderSource(shader, source)
    gl.compileShader(shader)
    const success = gl.getShaderParameter(shader, gl.COMPILE_STATUS)
    if(success){
        return shader
    }
    console.log(gl.getShaderInfoLog(shader))
    gl.deleteShader(shader)
}
function createProgram(gl, vertexShader, fragmentShader){
    if(!(vertexShader && fragmentShader)){
        console.log("Shader missing.")
        return
    }
    const program = gl.createProgram()
    gl.attachShader(program, vertexShader)
    gl.attachShader(program, fragmentShader)
    gl.linkProgram(program)
    const success = gl.getProgramParameter(program, gl.LINK_STATUS)
    if(success){
        return program
    }
    console.log(gl.getProgramInfoLog(program))
    gl.deleteProgram(program)
}
function createBuffer(gl, data, usage){
    const buffer = gl.createBuffer()
    gl.bindBuffer(gl.ARRAY_BUFFER, buffer)
    gl.bufferData(gl.ARRAY_BUFFER, data, usage || gl.STATIC_DRAW)
    return buffer
}
function update_buffer(gl, buffer, data, usage){
    gl.bindBuffer(gl.ARRAY_BUFFER, buffer)
    gl.bufferData(gl.ARRAY_BUFFER, data, usage || gl.STATIC_DRAW)
}
function createAndSetupTexture(gl, wrap, filter) {

    gl.bindTexture(gl.TEXTURE_2D, texture)
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, wrap || gl.CLAMP_TO_EDGE)
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, wrap || gl.CLAMP_TO_EDGE)
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, filter || gl.NEAREST)
    gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, filter || gl.NEAREST)
    return texture;
}

<script type="shader" id="vs1">
#version 300 es

precision highp float;
precision highp int;
precision highp sampler2D;
precision highp isampler2D;

layout(location = 0) in vec2 a_vertex_pos;
layout(location = 1) in vec4 a_tile_sq;
layout(location = 2) in int a_idx;

uniform vec4 u_camera_sq;
uniform isampler2D status_tex;
uniform vec3 u_resolution;

out vec2 v_pos;
out vec4 v_sq_inv;
out vec4 v_sq_trans_inv;
out vec2 v_texture_offset;

vec4 sqm(vec4 a, vec4 b){
    return vec4(
        a.x*b.x - a.y*b.y + a.z*b.z + a.w*b.w,
        a.x*b.y + a.y*b.x + a.w*b.z - a.z*b.w,
        a.x*b.z + a.z*b.x + a.w*b.y - a.y*b.w,
        a.x*b.w + a.w*b.x + a.y*b.z - a.z*b.y 
    );
}

vec2 hyperbolic_transform(vec4 q, vec2 p){
    float ar = p.x;
    float at = p.y;
    float ur = q.x * ar - q.y * at + q.z;
    float ut = q.x * at + q.y * ar + q.w;
    float dr = q.z * ar + q.w * at + q.x;
    float dt = q.z * at - q.w * ar - q.y;
    float d = dr * dr + dt * dt;
    return vec2(
        (ur * dr + ut * dt) / d,
        (ut * dr - ur * dt) / d
    );
}

vec2 sq_center(vec4 q){
    float ur = q.z;
    float ut = q.w;
    float dr = q.x;
    float dt = -q.y;
    float d = dr * dr + dt * dt;
    return vec2(
        (ur * dr + ut * dt) / d,
        (ut * dr - ur * dt) / d
    );
}

void main(){
    vec4 sq = sqm(u_camera_sq, a_tile_sq);
    vec2 pos = hyperbolic_transform(sq, a_vertex_pos);
    

    vec2 sq_center = sq_center(sq);
    vec4 sq_trans_inv = length(sq.xy) * vec4(1, 0, -sq_center);


    gl_Position = vec4(pos * u_resolution.z / u_resolution.xy, 0.0, 1.0);

    v_pos = pos;
    v_sq_inv = sq * vec4(1, -1, -1, -1);
    v_sq_trans_inv = sq_trans_inv;

    int quotient_idx = texelFetch(status_tex, ivec2(a_idx, 0), 0).r;
    v_texture_offset = vec2(quotient_idx % 4, quotient_idx / 4) / 4.0 + 1.0/8.0;
}

<script type="shader" id="fs1">
#version 300 es

precision highp float;
precision highp int;
precision highp sampler2D;
precision highp isampler2D;

in vec2 v_pos;
in vec4 v_sq_inv;
in vec4 v_sq_trans_inv;
in vec2 v_texture_offset;

uniform sampler2D number_tex;

out vec4 outColor;

vec2 hyperbolic_transform(vec4 q, vec2 p){
    float ar = p.x;
    float at = p.y;
    float ur = q.x * ar - q.y * at + q.z;
    float ut = q.x * at + q.y * ar + q.w;
    float dr = q.z * ar + q.w * at + q.x;
    float dt = q.z * at - q.w * ar - q.y;
    float d = dr * dr + dt * dt;
    return vec2(
        (ur * dr + ut * dt) / d,
        (ut * dr - ur * dt) / d
    );
}

const float PI = 3.14159265358979;
const float border = 0.5558929702514214;

void main(){
    vec2 pos_in_tile = hyperbolic_transform(v_sq_inv, v_pos);
    vec2 pos_klein = pos_in_tile * 2.0 / (1.0 + pos_in_tile.x * pos_in_tile.x + pos_in_tile.y * pos_in_tile.y);
    float max_dist = pos_klein.x;
    for(int i = 1; i < 5; i++){
        max_dist = max(max_dist, dot(pos_klein, vec2(cos(PI * 0.4 * float(i)), sin(PI * 0.4 * float(i)))));
    }
    if(max_dist > border - 0.03){
        outColor = vec4(vec3(0xcb, 0xd5, 0xe1) / 255.0, 1.0);
    }else{
        vec2 pos_in_tile_trans = hyperbolic_transform(v_sq_trans_inv, v_pos);
        vec3 tile_color = texture(number_tex, pos_in_tile_trans * 0.3125 + v_texture_offset).rgb;
        outColor = vec4(tile_color, 1);
    }
}

<script>
class HyperbolicTransform{
    // 分裂四元数 r + x i + y j + z k
    // i^2 = -1, j^2 = 1, k^2 = 1,
    // i j = -j i = k, -i k = k i = j, -j k = k j = i
    // 矩阵形式 Mat = 
    // [[r + x i, y + z i], 
    //  [y - z i, r - x i]]
    constructor(r = 1, x = 0, y = 0, z = 0){
        this.r = r
        this.x = x
        this.y = y
        this.z = z
    }
    times(b){
        const a = this
        return new HyperbolicTransform(
            a.r * b.r - a.x * b.x + a.y * b.y + a.z * b.z,
            a.r * b.x + a.x * b.r + a.z * b.y - a.y * b.z,
            a.r * b.y + a.y * b.r + a.z * b.x - a.x * b.z,
            a.r * b.z + a.z * b.r + a.x * b.y - a.y * b.x
        )
    }
    norm(){
        const q = this
        return q.r * q.r + q.x * q.x - q.y * q.y - q.z * q.z
    }
    normalize(){
        const q = this
        const l = Math.sqrt(q.norm())
        return new HyperbolicTransform(q.r / l, q.x / l, q.y / l, q.z / l)
    }
    inverse(){
        const q = this
        const n = q.norm()
        return new HyperbolicTransform(q.r / n, -q.x / n, -q.y / n, -q.z / n)
    }
    transform(a){
        const q = this
        const [ar, at] = a
        const ur = q.r * ar - q.x * at + q.y
        const ut = q.r * at + q.x * ar + q.z
        const dr = q.y * ar + q.z * at + q.r
        const dt = q.y * at - q.z * ar - q.x
        const d = dr * dr + dt * dt
        return [
            (ur * dr + ut * dt) / d,
            (ut * dr - ur * dt) / d
        ]
    }
    center(){
        const q = this
        const d = q.r * q.r + q.x * q.x
        return [
            (q.r * q.y - q.x * q.z) / d,
            (q.r * q.z + q.x * q.y) / d
        ]
    }
    inverse_transform(a){
        const q = this
        const [ar, at] = a
        const ur = q.r * ar + q.x * at - q.y
        const ut = q.r * at - q.x * ar - q.z
        const dr =-q.y * ar - q.z * at + q.r
        const dt =-q.y * at + q.z * ar + q.x
        const d = dr * dr + dt * dt
        return [
            (ur * dr + ut * dt) / d,
            (ut * dr - ur * dt) / d
        ]
    }
    static rotate(t){
        return new HyperbolicTransform(Math.cos(t / 2), Math.sin(t / 2), 0, 0)
    }
    static forward(t){
        return new HyperbolicTransform(Math.cosh(t / 2), 0, Math.sinh(t / 2), 0)
    }
    static move_to(coordinate){
        const [x, y] = coordinate
        const l = Math.sqrt(1 - x * x - y * y)
        return new HyperbolicTransform(1 / l, 0, x / l, y / l)
    }
    static move_from(coordinate){
        const [x, y] = coordinate
        const l = Math.sqrt(1 - x * x - y * y)
        return new HyperbolicTransform(1 / l, 0, -x / l, -y / l)
    }
    static move_from_to(c1, c2){
        return HyperbolicTransform.move_to(c2).times(HyperbolicTransform.move_from(c1))
    }
}

class Permutation{
    constructor(l = []){
        this.l = l
    }
    times(q){
        const p = this
        const r = []
        for(let i = 0; i < p.l.length; i++){
            const j = q.l[i]
            r.push(p.l[j])
        }
        return new Permutation(r)
    }
    permute(arr){
        const p = this
        const r = []
        for(let i = 0; i < p.l.length; i++){
            r.push(arr[p.l[i]])
        }
        return r
    }
    static identity(n = 0){
        const l = []
        for(let i = 0; i < n; i++){
            l.push(i)
        }
        return new Permutation(l)
    }
}

class Minesweeper {
    constructor(adjList, mine_num) {
        this.adj = adjList
        this.totalGrid = adjList.length
        this.totalMines = mine_num
        
        this.STATE_UNOPENED = 12
        this.STATE_FLAG = 13
        this.STATE_MINE_EXPLODED = 15

        this.board = new Array(this.totalGrid).fill(this.STATE_UNOPENED)
        this.mines = new Array(this.totalGrid).fill(false)
        this.numbers = new Array(this.totalGrid).fill(0)
        
        this.explored = 0
        this.flaggedCount = 0
        this.win = false
        this.gameOver = false
        this.initialized = false
    }

    // 第一次点击时部署雷区
    initMines(firstIdx) {
        let safeZone = new Set([firstIdx, ...this.adj[firstIdx]])
        let placedMines = 0
        
        while (placedMines < this.totalMines) {
            let idx = Math.floor(Math.random() * this.totalGrid)
            if (!this.mines[idx] && !safeZone.has(idx)) {
                this.mines[idx] = true
                placedMines++
            }
        }

        // 计算数字
        for (let i = 0; i < this.totalGrid; i++) {
            if (this.mines[i]) continue
            this.numbers[i] = this.adj[i].filter(nIdx => this.mines[nIdx]).length
        }
        this.initialized = true
    }

    is_openable(idx) {
        return this.board[idx] === this.STATE_UNOPENED || this.board[idx] === this.STATE_FLAG
    }

    is_flagged(idx) {
        return this.board[idx] === this.STATE_FLAG || this.board[idx] === this.STATE_MINE_EXPLODED
    }

    open(idx) {
        if (this.board[idx] === this.STATE_FLAG) {
            this.flaggedCount--
            this.explored--
        }

        if (this.mines[idx]) {
            this.board[idx] = this.STATE_MINE_EXPLODED
            this.explored++
            this.flaggedCount++
            this.gameOver = true
            return []
        }

        this.board[idx] = this.numbers[idx]
        this.explored++
        
        if (this.numbers[idx] === 0) {
            return this.adj[idx].filter(nIdx => this.is_openable(nIdx))
        }
        return []
    }

    action(idx, a) {
        if (this.win || this.gameOver) return

        // 处理插旗逻辑 (允许不相邻插旗)
        if (a === 'r') {
            if (this.board[idx] === this.STATE_UNOPENED) {
                this.board[idx] = this.STATE_FLAG
                this.flaggedCount++
                this.explored++
            } else if (this.board[idx] === this.STATE_FLAG) {
                this.board[idx] = this.STATE_UNOPENED
                this.flaggedCount--
                this.explored--
            }
        } 
        // 处理翻开逻辑
        else {
            // 第一次点击初始化
            if (!this.initialized) this.initMines(idx)

            let stack = []
            if (this.board[idx] === this.STATE_UNOPENED) {
                stack = [idx]
            } else if (this.board[idx] <= 10) {
                // 和弦逻辑
                let flags = this.adj[idx].filter(nIdx => this.is_flagged(nIdx)).length
                if (this.numbers[idx] === flags) {
                    stack = this.adj[idx].filter(nIdx => !this.is_flagged(nIdx) && this.board[nIdx] === this.STATE_UNOPENED)
                }
            }

            while (stack.length > 0) {
                let currIdx = stack.pop()
                if (!this.is_openable(currIdx)) continue
                let nextToOpen = this.open(currIdx)
                stack.push(...nextToOpen)
            }
        }

        // 胜利判定
        if (!this.gameOver && this.totalGrid - this.explored + this.flaggedCount === this.totalMines) {
            this.win = true
        }
    }
}

const tile_display = data.tile.filter(t => Math.hypot(...(new HyperbolicTransform(...t.t)).center()) < 0.99901)

function render() {
    gl.viewport(0, 0, canvas.width, canvas.height)

function update_status(){
    gl.activeTexture(gl.TEXTURE0)
    gl.texImage2D(gl.TEXTURE_2D, 0, gl.R16I, minesweeper.board.length, 1, 0, gl.RED_INTEGER, gl.SHORT, new Int16Array(perm.permute(minesweeper.board)))
    need_redraw = true
}

function check_transform_tile(){
    if (Math.hypot(...sq.center()) > 0.4) {
        const lst = data.tile_transform
            .map((t, n) => {
                const a = sq.times(new HyperbolicTransform(...t))
                return { a, n, d: Math.hypot(...a.center()) }
            })
            .sort((a, b) => a.d - b.d)
        const idx = lst[0].n
        sq = sq.times(new HyperbolicTransform(...data.tile_transform[idx]))
        perm = perm.times(new Permutation(data.quotient_transform[level][idx]))
        update_status()
        //console.log("transform")
    }
}

function find_tile_idx(pos){
    const pos_temp = sq.inverse().transform(pos)
    for(const tile of tile_display){
        const q = new HyperbolicTransform(...tile.t)
        const [x, y] = q.inverse().transform(pos_temp)
        const d = 2 / (1 + x * x + y * y)
        const [x0, y0] = [x * d, y * d]
        let max_dist = x0
        for(let i = 1; i < 5; i++){
            max_dist = Math.max(max_dist, x0 * Math.cos(Math.PI * 0.4 * i) + y0 * Math.sin(Math.PI * 0.4 * i))
        }
        if(max_dist <= 0.5558929702514214){
            return perm.l[tile.i[level]]
        }
    }
    return null
}

function update_pos(sq2){
    sq = sq2.times(sq)
    need_redraw = true
}

function update_scale(scale2){
    disk_scale *= scale2
    disk_scale = Math.max(disk_scale, 0.25)
    disk_scale = Math.min(disk_scale, 4)
    need_redraw = true
}

function resize(){
	const width = window.innerWidth
	const height = window.innerHeight
	const resolution = (window.devicePixelRatio || 1)
	const pixel_width = Math.round(width * resolution)
	const pixel_height = Math.round(height * resolution)
	const new_width = pixel_width / resolution
	const new_height = pixel_height / resolution
	canvas.style.width = new_width + "px"
	canvas.style.height = new_height + "px"
	canvas.width = pixel_width
	canvas.height = pixel_height
    need_redraw = true
}

function click(pos, action){
    const idx = find_tile_idx(pos)
    if(idx === null){
        return
    }
    minesweeper.action(idx, action)
    update_status()
}

function activate_mouse_event(){
    let mouse_down_idx = 0
    let mouse_is_down = false
    let mouse_click_action = null
    let mouse_is_rotate = false

    let prev_mouse_pos = [0, 0]

    function get_mouse_pos(e){
        const w = canvas.clientWidth
        const h = canvas.clientHeight
        const r = disk_scale * Math.min(w, h) / 2
        const x = (e.offsetX - w / 2) / r
        const y = (h / 2 - e.offsetY) / r
        return [x, y]
    }

    function clamp_to_radius(pos, r){
        const [x, y] = pos
        const r0 = Math.hypot(x, y)
        if(r0 > r){
            return [x / r0 * r, y / r0 * r]
        }else{
            return [x, y]
        }
    }

    canvas.addEventListener("contextmenu", e => {
        e.preventDefault()
    })

    const clamp_radius = 0.975

    canvas.addEventListener("mousedown", e => {
        e.preventDefault()
        const pos = get_mouse_pos(e)
        prev_mouse_pos = pos
        const [x, y] = pos
        mouse_down_idx += 1
        mouse_is_down = true
        mouse_is_rotate = Math.hypot(x, y) > clamp_radius
        //console.log("mouse down")
        if(e.buttons === 1 && !mouse_is_rotate){
            mouse_click_action = "l"
        }else if(e.buttons === 2 && !mouse_is_rotate){
            mouse_click_action = "r"
        }else{
            mouse_click_action = null
        }
    })

    canvas.addEventListener("mousemove", e => {
        e.preventDefault()
        const pos = get_mouse_pos(e)
        if(mouse_is_down){
            if(mouse_is_rotate){
                const [x1, y1] = pos
                const t1 = Math.atan2(y1, x1)
                const [x0, y0] = prev_mouse_pos
                const t0 = Math.atan2(y0, x0)
                update_pos(HyperbolicTransform.rotate(t1 - t0))
            }else{
                const sq_trans = HyperbolicTransform.move_from_to(
                    clamp_to_radius(prev_mouse_pos, clamp_radius),
                    clamp_to_radius(pos, clamp_radius)
                )
                update_pos(sq_trans)
            }
        }
        prev_mouse_pos = pos
        mouse_click_action = null
    })

    canvas.addEventListener("mouseup", e => {
        e.preventDefault()
        const pos = get_mouse_pos(e)
        prev_mouse_pos = pos

        if(mouse_click_action !== null){
            click(pos, mouse_click_action)
        }

        mouse_is_down = false
        mouse_is_rotate = false
        mouse_click_action = null
        //console.log("mouse up")
    })

    canvas.addEventListener("wheel", e => {
        update_scale(Math.exp(-e.deltaY / 1000))
    })
}

function activate_touch_event(){
    let touch_idx = 0
    let touch_is_down = false
    let touch_is_rotate = false
    let touch_is_static = false

    let prev_touch_pos = [0, 0]
    let prev_touch_dist = 0

    const clamp_radius = 0.95
    function get_touch_pos(touch) {
        const rect = canvas.getBoundingClientRect()
        const w = canvas.clientWidth
        const h = canvas.clientHeight
        const r = disk_scale * Math.min(w, h) / 2
        const x = (touch.clientX - rect.left - w / 2) / r
        const y = (h / 2 - (touch.clientY - rect.top)) / r
        return [x, y]
    }
    function get_touch_dist(t1, t2) {
        const dx = t1.clientX - t2.clientX
        const dy = t1.clientY - t2.clientY
        return Math.hypot(dx, dy)
    }
    function clamp_to_radius(pos, r) {
        const [x, y] = pos
        const r0 = Math.hypot(x, y)
        if (r0 > r) {
            return [x / r0 * r, y / r0 * r]
        } else {
            return [x, y]
        }
    }
    canvas.addEventListener("touchstart", e => {
        e.preventDefault()
        if (e.touches.length === 1) {
            const pos = get_touch_pos(e.touches[0])
            prev_touch_pos = pos

            touch_is_down = true
            touch_idx += 1

            const [x, y] = pos
            touch_is_rotate = Math.hypot(x, y) > clamp_radius

            touch_is_static = true

            const current_idx = touch_idx
            setTimeout(() => {
                if(touch_idx === current_idx && touch_is_down && touch_is_static && !touch_is_rotate){
                    click(pos, "r")
                    touch_is_down = false
                    touch_is_static = false
                }
            }, 333)
        } else if (e.touches.length === 2) {
            touch_is_down = false
            touch_is_static = false
            prev_touch_dist = get_touch_dist(e.touches[0], e.touches[1])
        } else {
            touch_is_down = false
            touch_is_static = false
        }
    }, { passive: false })

    canvas.addEventListener("touchmove", e => {
        e.preventDefault()
        if (e.touches.length === 1 && touch_is_down) {
            const pos = get_touch_pos(e.touches[0])
            if (touch_is_rotate) {
                const [x1, y1] = pos
                const t1 = Math.atan2(y1, x1)
                const [x0, y0] = prev_touch_pos
                const t0 = Math.atan2(y0, x0)
                update_pos(HyperbolicTransform.rotate(t1 - t0))
            } else {
                const sq_trans = HyperbolicTransform.move_from_to(
                    clamp_to_radius(prev_touch_pos, clamp_radius),
                    clamp_to_radius(pos, clamp_radius)
                )
                update_pos(sq_trans)
            }
            prev_touch_pos = pos
        } else if (e.touches.length === 2) {
            const current_dist = get_touch_dist(e.touches[0], e.touches[1])
            if (prev_touch_dist > 0) {
                const ratio = current_dist / prev_touch_dist
                update_scale(ratio)
            }
            prev_touch_dist = current_dist
        }
        touch_is_static = false
    }, { passive: false })

    canvas.addEventListener("touchend", e => {
        e.preventDefault()
        if (e.touches.length === 0) {
            if(touch_is_down && touch_is_static && !touch_is_rotate){
                click(prev_touch_pos, "l")
            }

            touch_is_down = false
            touch_is_rotate = false
            prev_touch_dist = 0
        } else if (e.touches.length === 1) {
            const pos = get_touch_pos(e.touches[0])
            prev_touch_pos = pos

            touch_is_down = true
            touch_idx += 1

            const [x, y] = pos
            touch_is_rotate = Math.hypot(x, y) > clamp_radius
        } else if(e.touches.length === 2) {
            touch_is_down = false
            prev_touch_dist = get_touch_dist(e.touches[0], e.touches[1])
        } else {
            touch_is_down = false
        }
        touch_is_static = false
    }, { passive: false })

    canvas.addEventListener("touchcancel", e => {
        touch_is_down = false
        touch_is_static = false
        prev_touch_dist = 0
    })
}

function update_info(){
    const text = 
`进度: ${minesweeper.flaggedCount} / ${minesweeper.totalMines}`
    document.getElementById("info").innerText = text
}

function render_loop() {
    check_transform_tile()
    if(need_redraw){
        render()
        update_info()
        //console.log("render")
    }
    need_redraw = false

    requestAnimationFrame(() => render_loop())
}



let visible = false
// 可被多次调用，每次清除原先状态
function init_game(new_level, mine_count){
    level = new_level
    minesweeper = new Minesweeper(data.quotient_neighbor[level], mine_count)
    sq = HyperbolicTransform.rotate(Math.PI / 2)//new HyperbolicTransform()
    perm = Permutation.identity(minesweeper.board.length)

    gl.bindBuffer(gl.ARRAY_BUFFER, tile_index_buffer)
    gl.bufferData(gl.ARRAY_BUFFER, new Int32Array(tile_display.map(t => t.i[level])), gl.STATIC_DRAW)
    gl.activeTexture(gl.TEXTURE0)
    gl.texImage2D(gl.TEXTURE_2D, 0, gl.R16I, minesweeper.board.length, 1, 0, gl.RED_INTEGER, gl.SHORT, new Int16Array(minesweeper.board))
    
    disk_scale = 0.9
    need_redraw = true

    if(!visible){
        visible = true
        document.getElementById("info").style.display = "inline-block"
        document.body.appendChild(canvas)
        activate_mouse_event()
        activate_touch_event()
        window.addEventListener("resize", resize)
        resize()
        render_loop()
    }
}

    </div>

<script>
(function() {
    const ctrlPanel = document.getElementById('control-panel');
    const resPanel = document.getElementById('result-panel');
    const mSlider = document.getElementById('mine-slider');
    const mNumDisp = document.getElementById('mine-num');
    const startBtn = document.getElementById('start-game-btn');

    const lvlData = {
        "0": { def: 20, max: 100, label: "初级" },
        "1": { def: 65, max: 200, label: "中级" },
        "2": { def: 140, max: 300, label: "高级" }
    };

    let startTime = 0;
    let statusCheck = null;

    document.querySelectorAll('input[name="lvl"]').forEach(r => {
        r.addEventListener('change', (e) => {
            const d = lvlData[e.target.value];
            mSlider.max = d.max;
            mSlider.value = d.def;
            mNumDisp.innerText = d.def;
        });
    });

    mSlider.addEventListener('input', (e) => mNumDisp.innerText = e.target.value);

    startBtn.addEventListener('click', () => {
        const lvl = document.querySelector('input[name="lvl"]:checked').value;
        const count = parseInt(mSlider.value);
        
        ctrlPanel.classList.add('hidden');
        startBtn.innerText = "开始新游戏";
        
        init_game(parseInt(lvl), count);
        
        startTime = Date.now();
        if(statusCheck) clearInterval(statusCheck);
        
        statusCheck = setInterval(() => {
            if (!minesweeper) return;
            if (minesweeper.win) {
                clearInterval(statusCheck);
                showResult(true);
            } else if (minesweeper.gameOver) {
                clearInterval(statusCheck);
                setTimeout(() => showResult(false), 500);
            }
        }, 200);
    });

    function showResult(isWin) {
        const timeUsed = Math.floor((Date.now() - startTime) / 1000);
        const lvlIdx = document.querySelector('input[name="lvl"]:checked').value;
        const statusEl = document.getElementById('res-status');
        
        statusEl.innerText = isWin ? "你过关！" : "你寄了";
        statusEl.className = isWin ? "card-title status-win" : "card-title status-lose";
        
        document.getElementById('stat-lvl').innerText = lvlData[lvlIdx].label;
        document.getElementById('stat-time').innerText = timeUsed + "s";

        const progLabel = document.getElementById('stat-prog-label');
        const progVal = document.getElementById('stat-prog-val');
        if (isWin) {
            progLabel.innerText = "地雷";
            progVal.innerText = minesweeper.totalMines;
        } else {
            progLabel.innerText = "进度";
            progVal.innerText = `${minesweeper.flaggedCount}/${minesweeper.totalMines}`;
        }
        resPanel.classList.remove('hidden');
    }

    document.getElementById('res-confirm').addEventListener('click', () => {
        resPanel.classList.add('hidden');
        ctrlPanel.classList.remove('hidden');
    });
})();
</script>
